import React from 'react';
import './App.css';


function Nav() {
    return (
        <nav>
            <h3>
                <img src="https://uploads-ssl.webflow.com/5da859aaea5d9e2e4b06adbd/5db17329b723f476956aa341_sharework%20fav%401x.svg" alt='logo' />
            </h3>
        </nav>
    )
}
export default Nav;
